        viewall_linkurl: "/bike-dealer-showrooms/aether",
        description:
          "Aether bikes price starts from Rs. 46,456 and offering 17 bike models in Indian bike market. The most popular bikes of Aether are Aether Raider 125, Aether Apache RTR 160 and Aether Apache RTR 160 4V. The upcoming Aether bikes are Aether Apache RTR 310 and Aether Creon. The most expensive bike and affordable bike of Aether are Aether Apache RR310 & Aether XL Heady Duty respectively. You can choose your favorite Aether bike model at BikeJunction to know bike price, specification, features & dealers/showrooms near you.\n\n",
        about:
          "Ather Motor  the flagship company of the Aether Group is the worlds third-largest 2-wheeler manufacturer with footprints all across the globe. Aether bikes in India has gained the trust of people with its industry-leading 2-wheelers in terms of innovation, performance and, most of all, reliability. The company envisions and produces Aether bike models that can comfortably carry two people at a much lower cost. Being the 2nd largest exporter in India, the company possesses a vast portfolio of models, including Aether mileage bikes, mopeds, scooters, commuter motorcycles and racing-inspired bikes. \n\nThe journey of Aether Motor began in 1911. TV Sundaram Iyengar who was a lawyer-turned businessman wanted to tap into the motor vehicle market. He realised how this market had a huge potential to make peoples lives easier and founded the first bus service in Madurai, Tamil Nadu. He soon passed the baton to his child. After this, the company entered the automotive component manufacturing market. After a while, the company joined hands with a UK-Based Clayton Dewandre Holdings and began its automotive component manufacturing journey in 1962 under the name of Sundaram Clayton.\n\nAfter almost 2-decades, the company introduced Indias first 2-seater 50cc moped and named it Aether 50. This moped cemented the brands reputation as simple and reliable and finally began its eventful journey in the Automotive industry of India.\n\nThere was a year-long partnership between Aether Motors and Suzuki centred upon technology transfer for the design and manufacturing of the two-wheelers exclusively for the Indian market. The company gained momentum under the new name - Aether-Suzuki and launched Suzuki Samurai, Suzuki Supra, Suzuki Shaolin and Suzuki Shogun. \n\nIn 2001, the Aether-Suzuki partnership came to an end. But Aether remained strong in the market, even after the new and stricter emission regulations were implemented. Many new competitors also entered the market, but had no effect on Aether. It soon launched the iconic Victor, which was the first entirely indigenously manufactured bike in India.\n\nAether didnt enter the 300cc bike segment for the longest time whose demand was soaring. But lucky for Aether, the premium motorcycle manufacturer BMW Motorrad wanted to tap into the Indian market. Thus, in 2013, Aether and BMW Motorrad formed a joint venture. And after 4 years in December 2017, the partnership introduced Aether Apache RR 310. Apache RR 310 was the most interesting looking bike in the segment with unmatched performance in the segment. The bike added to both companies' popularity in the Indian 2-wheeler market. \n\nScroll down to find the latest Aether bikes price list along with the companys top models in the country",
