const generateClassificationId = (fueltype, categoryId) => {
  if (categoryId === 1 && fueltype === 1) {
    return 1;
  } else if (categoryId === 1 && fueltype === 2) {
    return 3;
  } else if (categoryId === 2 && fueltype === 1) {
    return 2;
  } else if ((categoryId === 2) & (fueltype === 2)) {
    return 4;
  }
};

const b = brands
  .map((item) => {
    const arr = [];
    item.map((i, index) => {
      const filterdBrand = starpiBrands.data.filter(
        (j) => j.attributes.brand_id === i.brand_id
      );
      if (filterdBrand.length) {
        if (index === 0) {
          arr.push({
            id: filterdBrand[0].id,
            classifications: [
              {
                id: generateClassificationId(i.fuel_type_id, i.category_id),
              },
            ],
          });
        } else {
          arr[0].classifications = [
            ...arr[0].classifications,
            { id: generateClassificationId(i.fuel_type_id, i.category_id) },
          ];
        }

        console.log(filterdBrand, item);
      }
    });
    return arr;
  })
  .filter(Boolean);

